		<script>
		var map = L.map('map', {
			zoomControl:true, maxZoom:19
		}).fitBounds([[25,-130],[52,-60]]);
		var basemap_0 = L.tileLayer('http://{s}.www.toolserver.org/tiles/bw-mapnik/{z}/{x}/{y}.png');
		basemap_0.addTo(map);
		var pointsgroup = L.featureGroup();
		function pop_prot(feature, layer) {
			var popupContent = 'name: ' + String(feature.properties['unit_name']) + '<br>rank: ' + String(feature.properties['scalerank']);
			layer.bindPopup(popupContent);
		}
		function protecland_marker(feature, latlng) {
			return L.circleMarker(latlng, {
				radius: 8.0,
				fillColor: '#11fe00',
				color: '#000000',
				weight: 1,
				opacity: 1.0,
				fillOpacity: 0.8
			})
		}
		var protecland = new L.geoJson(exp_ne10mparksandprotectedlandspoint,{
			onEachFeature: pop_prot,
			pointToLayer: protecland_marker
		});
		protecland.addTo(pointsgroup);
		pointsgroup.addTo(map);
		function pop_popplaces(feature, layer) {
			var popupContent = 'name: ' + String(feature.properties['name']) + '<br>pop_max: ' + String(feature.properties['pop_max']);
			layer.bindPopup(popupContent);
		}
		function popplaces_marker(feature, latlng) {
			return L.circleMarker(latlng, {
				radius: 8.0,
				fillColor: '#ff0000',
				color: '#000000',
				weight: 1,
				opacity: 1.0,
				fillOpacity: 0.8
			})
		}
		var popplaces = new L.geoJson(exp_popplaces,{
			onEachFeature: pop_popplaces,
			pointToLayer: popplaces_marker
		});
		var cluster_popplaces= new L.MarkerClusterGroup({showCoverageOnHover: false});
		cluster_popplaces.addLayer(popplaces);
		cluster_popplaces.addTo(map);
		var baseMaps = {'OSM Black & White': basemap_0};
		var controler = L.control.layers(baseMaps,{"places": cluster_popplaces,"protected land points": pointsgroup},{collapsed:false}).addTo(map);
		var slidervar = document.getElementById('slider');
		noUiSlider.create(slidervar, {
			connect: true,
			start: [ 1, 10 ],
			step: 1,
			range: {
				min: 1,
				max: 10
			}
		});
		document.getElementById('input-number-min').setAttribute("value", 1);
		document.getElementById('input-number-max').setAttribute("value", 10);
		var inputNumberMin = document.getElementById('input-number-min');
		var inputNumberMax = document.getElementById('input-number-max');
		inputNumberMin.addEventListener('change', function(){
			slidervar.noUiSlider.set([this.value.round(), null]);
		});
		inputNumberMax.addEventListener('change', function(){
			slidervar.noUiSlider.set([null, this.value]);
		});
		slidervar.noUiSlider.on('update', function( values, handle ) {
			console.log(handle);
			if (handle==0){
				document.getElementById('input-number-min').value = values[0];
			} else {
				document.getElementById('input-number-max').value =  values[1];
			}
			rangeMin = document.getElementById('input-number-min').value;
			rangeMax = document.getElementById('input-number-max').value;
			//first let's clear the layer:
			pointsgroup.removeLayer(protecland);
			//and repopulate it
			protecland = new L.geoJson(exp_ne10mparksandprotectedlandspoint,{
				onEachFeature: pop_prot,
				filter:
					function(feature, layer) {
						 return (feature.properties.scalerank <= rangeMax) && (feature.properties.scalerank >= rangeMin);
					},
				pointToLayer: protecland_marker
			})
			//and back again into the cluster group
			protecland.addTo(pointsgroup)
			controler.removeFrom(map)
			controler = L.control.layers(baseMaps,{"places": cluster_popplaces,"protected land points": pointsgroup},{collapsed:false}).addTo(map);
		});
	</script>


</body></html>
